,time:1000,paramType:"",requestCount:0},style:{rotate:0,opacity:1,width:200,height:41,fontSize:"",fontWeight:400,lineHeight:"",letterSpacing:0,textAlign:"",color:"",top:387,left:1},id:21},{animations:[],events:{},groupStyle:{},isLock:false,id:22,component:"Picture",label:"图片",icon:"",propValue:{url:"data:image/jpeg;base64,",flip:{horizontal:false,vertical:false}},style:{rotate:0,opacity:1,top:428,left:1,width:178,height:169}},{animations:[],events:{},groupStyle:{},isLock:false,id:23,component:"Picture",label:"图片",icon:"",propValue:{url:"data:image/jpeg;base64,",flip:{horizontal:false,vertical:false}},style:{rotate:0,opacity:1,top:428,left:194.5,width:139,height:124}},{animations:[],events:{},groupStyle:{},isLock:false,component:"VButton",label:"按钮",propValue:"首页",icon:"button",style:{rotate:0,opacity:1,width:100,height:34,borderWidth:1,borderColor:"",borderRadius:"",fontSize:"",fontWeight:400,lineHeight:"",letterSpacing:0,textAlign:"",color:"",backgroundColor:"",top:605,left:1},id:24},{animations:[],events:{},groupStyle:{},isLock:false,component:"VButton",label:"按钮",propValue:"分类",icon:"button",style:{rotate:0,opacity:1,width:100,height:34,borderWidth:1,borderColor:"",borderRadius:"",fontSize:"",fontWeight:400,lineHeight:"",letterSpacing:0,textAlign:"",color:"",backgroundColor:"",top:605,left:136},id:25},{animations:[],events:{},groupStyle:{},isLock:false,component:"VButton",label:"按钮",propValue:"购物车",icon:"button",style:{rotate:0,opacity:1,width:100,height:34,borderWidth:1,borderColor:"",borderRadius:"",fontSize:"",fontWeight:400,lineHeight:"",letterSpacing:0,textAlign:"",color:"",backgroundColor:"",top:605,left:261},id:26}]
            ,
            defaultComponentData2:[],
            defaultCanvasData1:{width:"360",height:"640",scale:100,color:"rgba(0, 0, 0, 1)",opacity:100,background:"#fff",fontSize:20,backgroundColor:"rgba(183, 235, 170, 1)"},
            defaultCanvasData2:{},
            activeIndex: 'myProject',
            activeName: 'attr',
            reSelectAnimateIndex: undefined,
            oldAvatar: window.sessionStorage.getItem('src'),
            projectName: ' ',
            prototypeName:' ',
            protoNames:[],
            isWindowShow:false,
            dialogVisible:false,
            insertData:{
                protoName: '',
                canvasHeight: 1200,
                canvasWidth: 1200,
            },
        }
    },
    computed: mapState([
        'componentData',
        'curComponent',
        'isClickComponent',
        'canvasStyleData',
        'editor',
    ]),
    created() {
        const that = this
        this.projectName = sessionStorage.getItem('project')
        this.$axios.post('/group/updateProjectCheckTime/',this.$qs.stringify({
            email: sessionStorage.getItem('email'),
            groupName: sessionStorage.getItem('group'),
            proName: sessionStorage.getItem('project')
        })).then(res =>{
            console.log(res)
        })
        this.$axios.post('/project/checkPrototypes/',this.$qs.stringify({
            email: sessionStorage.getItem('email'),
            groupName: sessionStorage.getItem('group'),
            proName: sessionStorage.getItem('project')
        })).then(res => {
            if(res.data.result === 0 && res.data.protoNames.length!==0){
                console.log(res)
                that.protoNames = res.data.protoNames
                that.prototypeName = res.data.protoNames[0]
                this.$axios.post('project/checkPrototype/', this.$qs.stringify({
                    email: sessionStorage.getItem('email'),
                    groupName: sessionStorage.getItem('group'),
                    proName: sessionStorage.getItem('project'),
                    protoName: that.prototypeName
                })).then(res => {
                    console.log(res)
                    if(res.data.result === 0){
                        this.$store.commit('setComponentData', this.resetID(JSON.parse(res.data.canvasData)))
                        this.$store.commit('setCanvasStyle', JSON.parse(res.data.canvasStyle))
                    }
                })
            }
        })
        console.log(that.prototypeName)
        // 全局监听按键事件
        listenGlobalKeyDown()
    },
    methods: {
        gotoUml(){
            this.$router.push({name: 'uml'})
        },
        createPrototype(){
            const that = this
            mapState.canvasStyleData = that.defaultCanvasData
            mapState.canvasStyleData.width=that.insertData.canvasWidth
            mapState.canvasStyleData.height=that.insertData.canvasHeight
            if(that.insertData.protoName.length!==0) {
                switch(that.model)
                {
                    case "a":
                        mapState.componentData = that.defaultComponentData1
                        mapState.canvasStyleData = that.defaultCanvasData1
                        break;
                    case "b":
                        mapState.componentData = that.defaultComponentData2
                        mapState.canvasStyleData = that.defaultCanvasData2
                        break;
                    default:
                        mapState.componentData = that.defaultComponentData
                }
                this.$axios.post('/project/createPrototype/', this.$qs.stringify({
                    email: sessionStorage.getItem('email'),
                    groupName: sessionStorage.getItem('group'),
                    proName: sessionStorage.getItem('project'),
                    protoName: that.insertData.protoName,
                    canvasData: JSON.stringify(mapState.componentData),
                    canvasStyle: JSON.stringify(mapState.canvasStyleData),
                    canvasHeight: that.insertData.canvasHeight,
                    canvasWidth: that.insertData.canvasWidth
                })).then(res => {
                    console.log(res)
                    if(res.data.result === 0){
                        that.$message.success("创建成功")
                        this.$axios.post('/project/checkPrototypes/',this.$qs.stringify({
                            email: sessionStorage.getItem("email"),
                            groupName: sessionStorage.getItem('group'),
                            proName: sessionStorage.getItem('project')
                        })).then(res => {
                            console.log(res)
                            if(res.data.result === 0){
                                that.insertData.protoName=''
                                that.protoNames = res.data.protoNames
                            }
                        })
                        that.dialogVisible = false
                    }else if(res.data.result === 1){
                        that.$message.error("错误的请求")
                    }else{
                        that.$message.error("原型名称已存在")
                    }
                })
            }
        },
        newProto(){
            const that = this
            that.dialogVisible=true
        },
        dialogClosed(){
            const that = this
            that.dialogVisible = false
        },
        showWindow(){
            this.isWindowShow=true
        },
        closeWindow(){
            this.isWindowShow=false
        },
        handleDelete(index,protoName){
            const that = this
            this.$axios.post('/project/removePrototype/', this.$qs.stringify({
                email: sessionStorage.getItem('email'),
                groupName: sessionStorage.getItem('group'),
                proName: sessionStorage.getItem('project'),
                protoName: protoName
            })).then(res =>{
                console.log(res)
                if(res.data.result === 0){
                    that.$message.success("删除项目成功")
                }else{
                    that.$message.error("请求错误")
                }
                this.$axios.post('/project/checkPrototypes/',this.$qs.stringify({
                    email: sessionStorage.getItem("email"),
                    groupName: sessionStorage.getItem('group'),
                    proName: sessionStorage.getItem('project')
                })).then(res =>{
                    console.log(res)
                    if(res.data.result === 0){
                        if(res.data.protoNames.length===0){
                            that.prototypeName=' '
                            that.protoNames = res.data.protoNames
                        }
                        else{
                            that.protoNames = res.data.protoNames
                            that.prototypeName = res.data.protoNames[0]
                            this.$axios.post('project/checkPrototype/', this.$qs.stringify({
                                email: sessionStorage.getItem('email'),
                                groupName: sessionStorage.getItem('group'),
                                proName: sessionStorage.getItem('project'),
                                protoName: that.prototypeName
                            })).then(res => {
                                console.log(res)
                                if(res.data.result === 0){
                                    this.$store.commit('setComponentData', this.resetID(JSON.parse(res.data.canvasData)))
                                    this.$store.commit('setCanvasStyle', JSON.parse(res.data.canvasStyle))
                                }
                            })
                        }
                    }
                })
            })
        },
        gotoDoc(){
            this.$router.push({name:'document'})
        },
        choosePro(item){
            const that = this
            that.prototypeName=item
            sessionStorage.setItem('protoName',item)
            this.$axios.post('project/checkPrototype/', this.$qs.stringify({
                email: sessionStorage.getItem('email'),
                groupName: sessionStorage.getItem('group'),
                proName: sessionStorage.getItem('project'),
                protoName: item
            })).then(res => {
                console.log(res)
                if(res.data.result === 0){
                    this.$store.commit('setComponentData', this.resetID(JSON.parse(res.data.canvasData)))
                    this.$store.commit('setCanvasStyle', JSON.parse(res.data.canvasStyle))

                }
            })
        },
        gotoCenter(){
            this.$router.push({name:'userInfo'})
        },
        handleSelect(key, keyPath) {
            if (key === '/workSpace/manageMember' || key === '/home' || key === '/workSpace/groupProject'
                || key === '/workSpace') {
                this.$router.push({ path: key })
            }
        },
        logout() {
            this.$confirm('此操作将退出登录, 是否继续?', '提示', {
                confirmButtonText: '确定',
                cancelButtonText: '取消',
                type: 'warning'
            }).then(() => {
                this.$message({
                    type: 'success',
                    message: '已退出登录!'
                });
                window.sessionStorage.clear();
                this.$router.push({path: '/login'});
            }).catch(() => {

            });
        },
        restore() {
        },

        goBack() {
            this.$router.push({ path: '/workSpace' })
        },

        resetID(data) {
            data.forEach(item => {
                item.id = generateID()
                if (item.component === 'Group') {
                    this.resetID(item.propValue)
                }
            })

            return data
        },

        handleDrop(e) {
            e.preventDefault()
            e.stopPropagation()
            const index = e.dataTransfer.getData('index')
            const rectInfo = this.editor.getBoundingClientRect()
            if (index) {
                const component = deepCopy(componentList[index])
                component.style.top = e.clientY - rectInfo.y
                component.style.left = e.clientX - rectInfo.x
                component.id = generateID()
                this.$store.commit('addComponent', { component })
                this.$store.commit('recordSnapshot')
            }
        },

        handleDragOver(e) {
            e.preventDefault()
            e.dataTransfer.dropEffect = 'copy'
        },

        handleMouseDown(e) {
            e.stopPropagation()
            this.$store.commit('setClickComponentStatus', false)
            this.$store.commit('setInEditorStatus', true)
        },

        deselectCurComponent(e) {
            if (!this.isClickComponent) {
                this.$store.commit('setCurComponent', { component: null, index: null })
            }

            // 0 左击 1 滚轮 2 右击
            if (e.button != 2) {
                this.$store.commit('hideContextMenu')
            }
        },
        initWebSocket() {
            this.websock=new WebSocket("ws://81.70.16.241:8001/saveDocument/"+this.url.replace(new RegExp('/',"g"),'_')+'/');
            this.websock.onmessage=this.websocketOnMessage;
            this.websock.onopen =this.websocketOnOpen;
            this.websock.onerror=this.websocketOnError;
            this.websock.onclose=this.websocketClose;
        },
        sendWebSocketMessage(msg){
            this.websock.send(JSON.stringify(msg))
        },
        websocketOnMessage(e){
            console.log(e.data)
        },
        websocketOnOpen(e){
            console.log(e)
        },
        websocketOnError(e){
            console.log(e)
        },
        websocketClose(e){
            console.log(e)
        },
    },
    mounted() {
        this.initWebSocket()
    },
    beforeDestroy() {

    }
}
</script>

